import React from 'react';
import './CreateAccount.css';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';


const CreateAccount = () => {
     const navigate = useNavigate();
     const [values, setValues] = useState({
        username: '',
        email: '',
        password: '',
     });
     const handleChange = (event) => {
        setValues({...values, [event.target.name]:[event.target.value]})
     }
     const handleSubmit = (event) => {
        event.preventDefault();
        console.log('Submitting email and password:', { values }); // Debugging log

        axios.post('http://localhost:4000/signup', { values })
            .then(res => {
                console.log('Registered successful');
            })
            .catch(err => {
                console.error('Error:', err);
            });
    }

    return (
        <div className = 'container'>
            <div className='signInBox'>
                <form onSubmit={handleSubmit}>
                <div className = 'email'>
                    <h1>Email</h1>
                    <input className='emailInput' type="text" placeholder="Enter Email" name = 'username' onChange ={handleChange}/> 
                    </div>
                    <div className = 'email'>
                    <h1>Username</h1>
                    <input className='usernameInput' type="text" placeholder="Enter Username" name='email' onChange ={handleChange}/> 
                    </div>
                    <div className='pass'>
                    <h1>Password</h1>
                    <input className='passwordInput' type="password" placeholder="Enter Password" name='password' onChange ={handleChange}/>
                    </div>
                    <div className='passConfirm'>
                    <h1>Confirm Password</h1>
                    <input className='passwordInput' type="password" placeholder="Enter Password"/>
                    </div>
                    <br />
                    <button className='signButton'>Create Account</button>
                    <br />
                    <div className='noAccount'>
                        Have an account?
                        <button className='createAccountLink' onClick={()=>{navigate('/sign-in')}}>Login here!</button>
                    </div>
                    
                </form>
            </div>
        </div>
    );
  };
  
  export default CreateAccount;
